import React from 'react'; 

const Footer = () => {
    return (
        <div>

      
            <div id="contact" style={{ height: '10vh' }}></div>

                <div class="col-lg-12"  style={{ backgroundColor: '#2c3e50', height: 'auto'}}>
                   
                   <div class="row"> 

                   
                        <div class="contact col-lg-8 col-md-8 col-sm-8 col-xs-8">
                            <h3> CONTACT </h3>
                            <p> TEL: +221 77 876 21 97</p>

                        </div>

                        <div class="copy col-lg-4 col-md-4 col-sm-3 col-xs-4 text-center">
                            <h3> copyright - 2020</h3>
                        </div>
                        
                    </div>


                </div>
        </div>
    )

}

export default Footer;
